import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Navbar.css'; // Import the CSS file for styling

const Navbar = ({logged, updateLogged}) => {
    return (
        <nav className="navbar">
            <ul className="nav-links">
                <li><Link to="/">Home</Link></li>
                <li><Link to="/about-us">About Us</Link></li>
                <li><Link to="/packages">Pricing</Link></li>

                {
                    logged ?
                        <li><Link className={"sign-button"} to="/home" onClick={() =>{updateLogged(false)}}>LogOut</Link></li>
                        :
                        <li><Link className={"sign-button"} to="/login" onClick={() =>{updateLogged(true)}}>Sign</Link></li>
                }


            </ul>
        </nav>
    );
};

export default Navbar;
